import axios from "axios";
import React, { useState } from "react";

const Home = () => {
  const [futurasMarcacoes, setFuturasMarcacoes] = useState({ marcacoes: [] });

  axios.get("http://localhost:5000/marcacoes").then((res) => {
    const marcacoes = res.data;
    setFuturasMarcacoes({ marcacoes: marcacoes });

    futurasMarcacoes.map((person) => {
      const { name, age, contact, reason, date } = person;
      return (
        <div>
          <h4>{name}</h4>
          <p>{age}</p>
          <p>{contact}</p>
          <p>{reason}</p>
          <p>{date}</p>
        </div>
      );
    });
  });

  return (
    <>
      <h2>Home</h2>
      <article>
        <h4>marcacoes</h4>
      </article>
    </>
  );
};

export default Home;
